INSERT INTO `journalarticle` VALUES ('c5feeeaf-70c0-4589-a0c8-2413be89f0a7',18995,11114,10180,10154,10406,'OpenQuote Admin','2013-02-13 17:29:41','2013-02-13 17:29:41',0,0,'11112',1.5,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">OpenQuote Project Links</Title></root>','openquote-project-links','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table border=\"0\" width=\"100%\">\n	<tbody>\n		<tr align=\"left\">\n			<td colspan=\"6\"\n				style=\"border-style: none none solid; border-color: #98b7c6; border-width: 1px\">\n				OpenQuote project resources</td>\n		</tr>\n		<tr>\n			<td>\n				<ul>\n					<li><a href=\"http://openquote.opensourceinsurance.org/\"\n						target=\"project_page\">Project home page</a></li>\n					<li><a href=\"http://sourceforge.net/projects/oquote\"\n						target=\"project_page\">SourceForge project</a></li>\n					<li><a href=\"http://openquotecommunity.org/jira\"\n						target=\"project_page\">Issue tracker</a></li>\n					<li><a\n						href=\"http://openquote.opensourceinsurance.org/index.php/support/support-forum\"\n						target=\"project_page\">Forums</a></li>\n					<li><a href=\"http://oquote.wiki.sourceforge.net/\"\n						target=\"project_page\">Wiki</a></li>\n					<li><a href=\"http://openquotecommunity.org/bamboo/\"\n						target=\"project_page\">Build server</a></li>\n				</ul>\n			</td>\n		</tr>\n		<tr>\n			<td>If you\'d like to get in contact with us, the <a\n				href=\"http://openquote.opensourceinsurance.org/index.php/support/support-forum/forum?id=11\"\n				target=\"project_page\">Open Discussion Forum</a> is an excellent\n				place to start.\n			</td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2012-11-05 08:03:00',NULL,NULL,1,0,11115,'',0,10406,'OpenQuote Admin','2013-02-13 17:29:41'),('149ba2e0-5392-4690-8c62-809c083a8e1a',21844,21845,21803,10154,10406,'OpenQuote Admin','2013-02-19 17:35:36','2013-02-19 17:35:36',0,0,'21843',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">Life Plus Links</Title></root>','life-plus-links','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<table border=\"0\" width=\"100%\">\n	<tbody>\n		<tr>\n			<td><a href=\"/portal/portal/Life%20Plus/Life%20Plus\">Life\n					Plus</a> - Get a quote, or manage quotes you&#39;ve saved. You may find\n				a cheaper quote elsewhere, but you won&#39;t find better value.</td>\n		</tr>\n		<tr>\n			<td><p>\n					<a href=\"/portal/portal/Life%20Plus/About%20Us\">About Us</a> - More\n					about us and how our in-depth knowledge, expert advice and\n					state-of-the-art technology can help you.\n				</p></td>\n		</tr>\n		<tr>\n			<td><a href=\"/portal/portal/Life%20Plus/About%20Life%20Plus\">About\n					Life Plus</a> - The most innovitive term life product on the market\n				today. How does it compare to the oppisition? How can we guarantee\n				that our offering is the best?</td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2013-02-19 17:34:00',NULL,NULL,1,0,21846,'',0,10406,'OpenQuote Admin','2013-02-19 17:35:36'),('092a039a-d04e-4ce8-bb94-e63c3d776c6d',21918,21860,21803,10154,10406,'OpenQuote Admin','2013-02-19 17:42:13','2013-02-19 17:42:13',0,0,'21858',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">Testimonials</Title></root>','testimonials','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<table border=\"0\" width=\"100%\">\n	<tbody>\n		<tr>\n			<td align=\"center\">\n				&nbsp;<img alt=\"\" src=\"/documents/21803/0/Jane+Smile.png/2359775f-3c2d-443b-94ee-e8f03840a691?t=1361295652811\" /></td>\n			<td align=\"center\" colspan=\"2\">\n				&nbsp;\"<em>This is the best damned term life policy I\'ve ever had. Life Plus saved me thousands of pounds and made my carpet smell good too!</em>\"<strong>- Jane Smile</strong></td>\n		</tr>\n		<tr>\n			<td colspan=\"3\">\n				&nbsp;</td>\n		</tr>\n		<tr>\n			<td align=\"center\" colspan=\"2\">\n				&nbsp;<em>\"If you only buy one term life product this year, make it Life Plus. You, your family and your descendants for several generations will thank you for it.</em>\"<strong>- Jimbo Greenshirt</strong></td>\n			<td align=\"center\">\n				&nbsp;<img alt=\"\" src=\"/documents/21803/0/Jimbo+Greenshirt.png/3dad80a0-b9ca-4f0e-897e-db1350b6d253?t=1361295662899\" /></td>\n		</tr>\n		<tr align=\"right\">\n			<td colspan=\"3\">\n				<font size=\"1\">&nbsp;Images under license from <a href=\"http://www.sxc.hu/\">www.sxc.hu</a> with grateful thanks to <a href=\"http://www.sxc.hu/profile/Cieleke\">Cieleke</a> for Jane Smile, and <a href=\"http://www.sxc.hu/profile/harrykeely\">harrykeely</a> for Jimbo Greenshirt. </font></td>\n		</tr>\n	</tbody>\n</table>\n<p>\n	&nbsp;</p>]]></static-content>\n</root>','general','','','','2013-02-19 17:36:00',NULL,NULL,1,0,21861,'',0,10406,'OpenQuote Admin','2013-02-19 17:42:13'),('9b050fee-8a8f-464e-a030-940ca243db97',21951,21952,21803,10154,10406,'OpenQuote Admin','2013-02-19 17:54:23','2013-02-19 17:54:23',0,0,'21950',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">About Life Plus</Title></root>','about-life-plus','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<table border=\"0\" width=\"100%\">\n	<tbody>\n		<tr>\n			<td valign=\"top\">\n				<img alt=\"\" src=\"/documents/21803/0/Question+Mark.png/e7341e6d-c94f-473a-b253-62b2e6f345a4?t=1361295670719\" /></td>\n			<td>\n				<h1>\n					What is Term Life insurance?</h1>\n				<p>\n					Term life insurance&nbsp;or&nbsp;term assurance&nbsp;is&nbsp;<a href=\"http://en.wikipedia.org/wiki/Life_insurance\">life insurance</a>&nbsp;which provides coverage at a fixed rate of payments for a limited period of time, the relevant term. After that period expires coverage at the previous rate of premiums is no longer guaranteed and the client must either forgo coverage or potentially obtain further coverage with different payments and/or conditions. If the insured dies during the term, the death benefit will be paid to the&nbsp;<a href=\"http://en.wikipedia.org/wiki/Beneficiary\">beneficiary</a>. Term insurance is the most inexpensive way to purchase a substantial death benefit on a coverage amount per premium pound basis.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\">\n				<img alt=\"\" src=\"/documents/21803/0/Question+Mark.png/e7341e6d-c94f-473a-b253-62b2e6f345a4?t=1361295670719\" style=\"width: 83px; height: 83px; \" /></td>\n			<td>\n				<h1>\n					Term Life? Whole Life? Universal Life? I\'m confused!?</h1>\n				<p>\n					Term life insurance is the original form of life insurance&nbsp;and can be contrasted to&nbsp;<a href=\"http://en.wikipedia.org/wiki/Permanent_life_insurance\">permanent life insurance</a>&nbsp;such as&nbsp;<a href=\"http://en.wikipedia.org/wiki/Whole_life_insurance\">whole life</a>,&nbsp;<a href=\"http://en.wikipedia.org/wiki/Universal_life_insurance\">universal life</a>, and&nbsp;<a href=\"http://en.wikipedia.org/wiki/Variable_universal_life_insurance\">variable universal life</a>, which guarantee coverage at fixed premiums for the lifetime of the covered individual. Many permanent life insurance products also build a predetermined cash value over the life of the contract, available for later withdrawal by the client under specific conditions. However, on most cash value policies like Whole Life insurance, the only way to receive the \"savings\" is to cash out the policy. The beneficiaries receive the face value of the insurance but NEVER the cash value with Whole Life policies. Financial advisers generally advise buying term life insurance and investing the difference elsewhere.</p>\n				<p>\n					Term insurance functions in a manner similar to most other types of insurance in that it satisfies claims against what is insured if the premiums are up to date and the contract has not expired, and does not expect a return of Premium dollars if no claims are filed. As an example, auto insurance will satisfy claims against the insured in the event of an accident and a home owner policy will satisfy claims against the home if it is damaged or destroyed by, for example, an earthquake or fire. Whether or not these events will occur is uncertain, and if the policy holder discontinues coverage because he has sold the insured car or home the insurance company will not refund the premium. This is purely risk protection.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\">\n				<img alt=\"\" src=\"/documents/21803/0/Question+Mark.png/e7341e6d-c94f-473a-b253-62b2e6f345a4?t=1361295670719\" style=\"width: 83px; height: 83px; \" /></td>\n			<td>\n				<h1>\n					How can it be used?</h1>\n				<p>\n					Because term life insurance is a pure death benefit, its primary use is to provide coverage of financial responsibilities, for the insured. Such responsibilities may include, but are not limited to, consumer debt, dependent care, college education for dependents, funeral costs, and mortgages. Term life insurance is generally chosen in favor of permanent life insurance because it is usually much less expensive (depending on the length of the term). Many financial advisors or other experts commonly recommend term life insurance as a means to cover potential expenses until such time that there are sufficient funds available from savings to protect those whom the insurance coverage was intended to protect. For exhttp://www.sxc.hu/profile/hisksample, an individual might choose to obtain a policy whose term expires near his or her retirement age based on the premise that, by the time the individual retires, he or she would have amassed sufficient funds in retirement savings to provide financial security for their dependents.</p>\n			</td>\n		</tr>\n		<tr align=\"right\">\n			<td>\n				&nbsp;</td>\n			<td class=\"portlet-font-dim\">\n				<font size=\"1\">Queston Mark image by&nbsp;<a href=\"http://www.sxc.hu/profile/hisks\">Kriss Szkurlatowski</a>. Under license from&nbsp;<a href=\"/portal/auth/portal/default/Product+Manager/www.sxc.hu\">www.sxc.hu</a><br />\n				Text source Wikipedia: <a href=\"/portal/auth/portal/default/Product+Manager/\">Term Life insurance</a></font></td>\n		</tr>\n	</tbody>\n</table>\n<p>\n	&nbsp;</p>]]></static-content>\n</root>','general','','','','2013-02-19 17:51:00',NULL,NULL,1,0,21953,'',0,10406,'OpenQuote Admin','2013-02-19 17:54:23'),('23202721-38a3-4d58-866f-a9a058ae326d',21961,21962,21803,10154,10406,'OpenQuote Admin','2013-02-19 17:55:23','2013-02-19 17:55:23',0,0,'21960',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">About Us</Title></root>','about-us','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<p>Life Plus was fonded in 1861 by a Jacob Section, a wealthy mill owner from Smallclaim in the county of Covershire. As a Quaker, Jacob held a keen interest in the well being of those who worked in his mill and was appauled to find that almost none of his works had appropriate levels of life insurance. He created the Life Plus product to meet this need and in so doing made his workers very grateful indeed.</p><p>Jacob died in 1878 but by this time Life Plus was well known and respected among the mill owners and workers of Covershire for offering very competitive leves of cover for extreemly reasonable premiums. His son, Homer Section took over the business and saw it grow throughout his life time. Following his marrage to Constants Policy the business diversified to also offer Homer and Constants insurance, but following the 1882 chip pan crisis this side of the business was sold.</p><p>The solid principals upon which Jacob founded the business remain our core values today. Our mission statement &quot;We sell life insurance&quot; captures the mood and drive of the organisation prefectly.</p><p>Over the years, life plus has won many awards for innovation and excellence, including biggest pancake of the year at the 1932 Covershire fair. <br /></p>]]></static-content>\n</root>','general','','','','2013-02-19 17:55:00',NULL,NULL,1,0,21963,'',0,10406,'OpenQuote Admin','2013-02-19 17:55:23'),('702eeaf2-9682-4400-a82c-cfd6b57247ce',22073,21923,21803,10154,10406,'OpenQuote Admin','2013-02-20 07:10:37','2013-02-20 07:10:37',0,0,'21921',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">Banner</Title></root>','banner','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<img alt=\"\" src=\"/documents/21803/0/Banner.png/af9ed3cd-4d87-4b30-88e1-c3d120668106?t=1361295684539\" style=\"width: 659px; height: 223px; \" />\n<br /><div align=\"right\"><font size=\"1\">Image under license from <a href=\"http://www.sxc.hu/\">www.sxc.hu</a>, with grateful thanks to <a href=\"http://www.sxc.hu/profile/dkmhl\">dkmhl</a>. </font></div>]]></static-content>\n</root>','general','','','','2013-02-19 17:42:00',NULL,NULL,1,0,21924,'',0,10406,'OpenQuote Admin','2013-02-20 07:10:37'),('45de0e62-e998-4d16-ba5e-3e453f881d1c',22138,22064,22020,10154,10406,'OpenQuote Admin','2013-02-20 07:15:53','2013-02-20 07:15:53',0,0,'22062',1.2,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">Banner</Title></root>','banner','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<table border=\"0\" cellspacing=\"0\" width=\"100%\"\n	style=\"background-color: #eeeeee\">\n	<tbody>\n		<tr>\n			<td rowspan=\"4\"><img\n				src=\"/documents/22020/0/Banner.png/0aa6116b-05cd-44ed-9e1a-e469536251a5?t=1361344388634\"\n				alt=\"\" />\n			<div align=\"right\"><font size=\"1\">Image \"LLoyds London\" under license\n			from <a href=\"http://www.sxc.hu/\">www.sxc.hu</a>, with grateful\n			thanks to <a href=\"http://www.sxc.hu/profile/telegram\">telegram</a>.\n			</font></div>\n			</td>\n			<td rowspan=\"4\" width=\"10px\">&nbsp;</td>\n			<td align=\"left\" valign=\"middle\">\n			<h1>Standing out as a broker is difficult,</h1>\n			</td>\n		</tr>\n		<tr>\n			<td align=\"right\" valign=\"middle\">\n			<h2>...but not impossible.</h2>\n			</td>\n		</tr>\n		<tr>\n			<td align=\"left\" valign=\"middle\">\n			<h1>With Irish Broker PI, we&#39;ve proved it.</h1>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"bottom\">\n			<p>Bluestone&#39;s Irish Broker PI is the leading professional\n			indemnity product available in the market today especially designed\n			for insurance brokers based in Ireland.</p>\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2013-02-20 07:07:00',NULL,NULL,1,0,22065,'',0,10406,'OpenQuote Admin','2013-02-20 07:15:53'),('1610dcba-c453-4d76-b080-7854f5d9a997',22147,22148,22020,10154,10406,'OpenQuote Admin','2013-02-20 07:20:00','2013-02-20 07:20:00',0,0,'22146',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">News</Title></root>','news','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<table border=\"0\">\n	<tbody>\n		<tr>\n			<td valign=\"top\" width=\"50%\">\n				<table border=\"0\">\n					<tbody>\n						<tr>\n							<td valign=\"top\">\n								<img alt=\"\" src=\"/documents/22020/0/clock.png/2628ab55-6d50-4d64-9d8a-7f52eb82a3ee?t=1361344399330\" /></td>\n							<td valign=\"top\">\n								<strong>Bluestone\'s Claim turn around times best in sector</strong>. A report by the OIF shows Bluestones claims handling to be the best in the PI sector, a full 25% more responsive than it\'s next leading competitor.</td>\n						</tr>\n						<tr>\n							<td colspan=\"2\">\n								&nbsp;</td>\n						</tr>\n						<tr>\n							<td valign=\"top\">\n								<img alt=\"\" src=\"/documents/22020/0/new+office.png/011c083a-3b3a-4731-b310-a646d597b779?t=1361344412147\" /></td>\n							<td valign=\"top\">\n								<strong>Bluestone announces the opening of a new regional office.</strong> Bluestone has opened it\'s third regional office. The new Dublin office opened last month joining Cork and Balfast in bring Irish Broker PI to more areas.</td>\n						</tr>\n					</tbody>\n				</table>\n			</td>\n			<td valign=\"top\" width=\"50%\">\n				<table border=\"0\">\n					<tbody>\n						<tr>\n							<td valign=\"top\">\n								<img alt=\"\" src=\"/documents/22020/0/hand.png/14b416a2-a54d-45bf-af49-cf742c2f795f?t=1361344405314\" /></td>\n							<td valign=\"top\">\n								<strong>Bluestone welcomes more new policy holders.</strong> Over the last year we are pleased to say that we have seen a 63% increase in new business take up over the previous year.</td>\n						</tr>\n						<tr>\n							<td colspan=\"2\">\n								&nbsp;</td>\n						</tr>\n						<tr>\n							<td valign=\"top\">\n								<img alt=\"\" src=\"/documents/22020/0/online.png/3314798b-24d4-4021-a783-ca301950017e?t=1361344424651\" /></td>\n							<td valign=\"top\">\n								<strong>Less paper work, and less red tape.</strong> Bluestone announced their online claims handling site today. This greatly simplifies the processing of claims and enables us