laims to be submitted, processed and paid. Currently concept only.</td>\n		</tr>\n	</tbody>\n</table>\n<p>\n	&nbsp;</p>\n<p>\n	OpenUnderwriter is distributed under the <a href=\"http://opensource.org/licenses/gpl-3.0.html\" target=\"_blank\">GNU General Public License</a>. This means you can download it and use it freely without charge as long as you comply with the license. Applied Industrial Logic - the original developers of OpenQuote - offer comprehensive commercial support and consultancy services should you require them, but you are not obliged to use them.</p>]]></static-content>\n</root>','general','','','','2013-09-01 21:04:00',NULL,NULL,1,0,52728,'',0,10406,'OpenQuote Admin','2013-09-01 21:38:55'),('5c814ba2-d55b-455a-a82e-670f6c129f93',53008,52727,48407,10154,10406,'OpenQuote Admin','2013-09-01 21:41:34','2013-09-01 21:41:34',0,0,'52725',1.2,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">Welcome to OpenUnderwriter</Title></root>','welcome-to-openunderwriter','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<p>\n	Welcome to OpenUnderwriter. OpenUnderwriter is an open source insurance solution created by <a href=\"http://www.appliedindustriallogic.com\">Applied Industrial Logic</a>. OpenUnderwriter is made up of OpenQuote, OpenActuary, OpenPolicy and OpenClaim. Each is desgined to be used either independently or integrated as part of a complete insurance solution. Use the links below to access the different areas of OpenUnderwriter.</p>\n<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"3\" style=\"width: 80%; \">\n	<tbody>\n		<tr>\n			<td style=\"text-align: center; \">\n				<img alt=\"\" src=\"/documents/48407/52723/logo+png+OpenActuary+h30px.png/07d872ce-709b-44cf-808f-b13b676d8cd0?t=1378070722398\" style=\"width: 188px; height: 30px; margin: 8px; \" /></td>\n			<